import React from 'react';
import styled from 'styled-components';
import {DashLinkGrid, DashLink, DashLabel} from './dashlinkhelper';

const DashStyled = styled.div`
    height: 500px;
    margin: 0px 200px 50px 100px;
`

export function DashHelper(){
    return <DashStyled>
        <h1>Admin Options</h1>
        <DashLinkGrid>
            <DashLink>
                <DashLabel>
                    Add Category
                </DashLabel>
            </DashLink>

            </DashLinkGrid>

    </DashStyled>
}
